import React from "react";
import "./App.css";

const NyListItem = props => {
  const { listArray } = props;
  return (
    <React.Fragment>
      <ul class="list-group">
        {listArray.length === 0
          ? "No records to show.."
          : listArray.map((item, i) => {
              return (
                <div className="flex-design">
                  <div class="rounded"></div>
                  <li class="list-group-item list-group-item-primary">
                    <div>
                      Most New York Coronavirus Cases Came From Europe, Genomes
                      Show
                    </div>
                  </li>
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    width="24"
                    height="24"
                    viewBox="0 0 24 24"
                  >
                    <path
                      fill="#0089CE"
                      fill-rule="nonzero"
                      d="M8 16.584L9.528 18 16 12 9.528 6 8 7.416 12.97 12z"
                    />
                  </svg>
                </div>
              );
            })}
      </ul>
    </React.Fragment>
  );
};

export default NyListItem;
